import { useEffect, useState } from "react";

function App() {
  const [users, setUsers] = useState([]);
  const [error, setError] = useState(null); // Add error state

  useEffect(() => {
    fetch("http://localhost:5000/users")
      .then((res) => {
        console.log("Response Status:", res.status); // Log status code
        return res.json();
      })
      .then((data) => {
        console.log("User Data:", data); // Log fetched user data
        setUsers(data);
      })
      .catch((err) => {
        console.error("Fetch Error:", err);
        setError("Failed to load users");
      });
  }, []);

  return (
    <div>
      <h1>GleeManager</h1>
      <h2>Users List</h2>
      {error && <p style={{ color: "red" }}>{error}</p>} {/* Show error if exists */}
      <ul>
        {users.length > 0 ? (
          users.map((user) => <li key={user.email}>{user.email} - {user.name}</li>)
        ) : (
          <p>No users available</p>
        )}
      </ul>
    </div>
  );
}

export default App;
